In it’s simplest form, most applications will have a main loop like this: fn main() -> Result<()> { let mut app = App::new(); let mut t = Tui::new()?; t.enter()?; // raw mode enabled loop { // get key event and update state // ... Special handling to read key or mouse events required here t.terminal.draw(|f| { // <- `terminal.draw` is the only ratatui function here ui(app, f) // render state to terminal })?; } t.exit()?; // raw mode disabled Ok(())
} Note The terminal.draw(|f| { ui(app, f); }) call is the only line in the code above that uses ratatui functionality. You can learn more about draw from the official documentation . Essentially, terminal.draw() takes a callback that takes a Frame and expects the callback to render widgets to that frame, which is then drawn to the terminal using a double buffer technique. While we are in the “raw mode”, i.e. after we call t.enter(), any key presses in that terminal window are sent to stdin. We have to read these key presses from stdin if we want to act on them. There’s a number of different ways to do that. crossterm has a event module that implements features to read these key presses for us. Let’s assume we were building a simple “counter” application, that incremented a counter when we pressed j and decremented a counter when we pressed k. fn main() -> Result { let mut app = App::new(); let mut t = Tui::new()?; t.enter()?; loop { if crossterm::event::poll(Duration::from_millis(250))? { if let Event::Key(key) = crossterm::event::read()? { match key.code { KeyCode::Char('j') => app.increment(), KeyCode::Char('k') => app.decrement(), KeyCode::Char('q') => break, _ => (), } } }; t.terminal.draw(|f| { ui(app, f) })?; } t.exit()?; Ok(())
} This works perfectly fine, and a lot of small to medium size programs can get away with doing just that. However, this approach conflates the key input handling with app state updates, and does so in the “draw” loop. The practical issue with this approach is we block the draw loop for 250 ms waiting for a key press. This can have odd side effects, for example pressing an holding a key will result in faster draws to the terminal. In terms of architecture, the code could get complicated to reason about. For example, we may even want key presses to mean different things depending on the state of the app (when you are focused on an input field, you may want to enter the letter "j" into the text input field, but when focused on a list of items, you may want to scroll down the list.) Pressing j 3 times to increment counter and 3 times in the text field We have to do a few different things set ourselves up, so let’s take things one step at a time. First, instead of polling, we are going to introduce channels to get the key presses asynchronously and send them over a channel. We will then receive on the channel in the main loop. There are two ways to do this. We can either use OS threads or “green” threads, i.e. tasks, i.e. rust’s async-await features + a future executor. Here’s example code of reading key presses asynchronously using std::thread and tokio::task.

