} struct EventHandler { rx: std::sync::mpsc::Receiver<Event>,
} impl EventHandler { fn new() -> Self { let tick_rate = std::time::Duration::from_millis(250); let (tx, rx) = std::sync::mpsc::channel(); std::thread::spawn(move || { loop { if crossterm::event::poll(tick_rate)? { match crossterm::event::read()? { CrosstermEvent::Key(e) => tx.send(Event::Key(e)), _ => unimplemented!(), }? } } }) EventHandler { rx } } fn next(&self) -> Result<Event> { Ok(self.rx.recv()?) }
}

