We are going to modify our EventHandler to handle a AppTick event. We want the Event::AppTick to be sent at regular intervals. We are also going to want to use a CancellationToken to stop the tokio task on request. tokio’s select! macro allows us to wait on multiple async computations and returns when a single computation completes. Here’s what the completed EventHandler code now looks like: use color_eyre::eyre::Result;
use crossterm::{ cursor, event::{Event as CrosstermEvent, KeyEvent, KeyEventKind, MouseEvent},
};
use futures::{FutureExt, StreamExt};
use tokio::{ sync::{mpsc, oneshot}, task::JoinHandle,
}; #[derive(Clone, Copy, Debug)]
pub enum Event { Error, AppTick, Key(KeyEvent),
} #[derive(Debug)]
pub struct EventHandler { _tx: mpsc::UnboundedSender<Event>, rx: mpsc::UnboundedReceiver<Event>, task: Option<JoinHandle<()>>, stop_cancellation_token: CancellationToken,
} impl EventHandler { pub fn new(tick_rate: u64) -> Self { let tick_rate = std::time::Duration::from_millis(tick_rate); let (tx, rx) = mpsc::unbounded_channel(); let _tx = tx.clone(); let stop_cancellation_token = CancellationToken::new(); let _stop_cancellation_token = stop_cancellation_token.clone(); let task = tokio::spawn(async move { let mut reader = crossterm::event::EventStream::new(); let mut interval = tokio::time::interval(tick_rate); loop { let delay = interval.tick(); let crossterm_event = reader.next().fuse(); tokio::select! { _ = _stop_cancellation_token.cancelled() => { break; } maybe_event = crossterm_event => { match maybe_event { Some(Ok(evt)) => { match evt { CrosstermEvent::Key(key) => { if key.kind == KeyEventKind::Press { tx.send(Event::Key(key)).unwrap(); } }, _ => {}, } } Some(Err(_)) => { tx.send(Event::Error).unwrap(); } None => {}, } }, _ = delay => { tx.send(Event::AppTick).unwrap(); }, } } }); Self { _tx, rx, task: Some(task), stop_cancellation_token } } pub async fn next(&mut self) -> Option<Event> { self.rx.recv().await } pub async fn stop(&mut self) -> Result<()> { self.stop_cancellation_token.cancel(); if let Some(handle) = self.task.take() { handle.await.unwrap(); } Ok(()) }
} Note Using crossterm::event::EventStream::new() requires the event-stream feature to be enabled. crossterm = { version = "0.26.1", default-features = false, features = ["event-stream"] } With this EventHandler implemented, we can use tokio to create a separate “task” that handles any key asynchronously in our main loop. I personally like to combine the EventHandler and the Tui struct into one struct. Here’s an example of that Tui struct for your reference. use std::{ ops::{Deref, DerefMut}, time::Duration,
}; use color_eyre::eyre::Result;
use crossterm::{ cursor, event::{Event as CrosstermEvent, KeyEvent, KeyEventKind, MouseEvent}, terminal::{EnterAlternateScreen, LeaveAlternateScreen},
};
use futures::{FutureExt, StreamExt};
use ratatui::backend::CrosstermBackend as Backend;
use serde::{Deserialize, Serialize};
use tokio::{ sync::mpsc::{self, UnboundedReceiver, UnboundedSender}, task::JoinHandle,
};
use tokio_util::sync::CancellationToken; pub type Frame<'a> = ratatui::Frame<'a, Backend<std::io::Stderr>>; #[derive(Clone, Debug, Serialize, Deserialize)]
pub enum Event { Init, Quit, Error, Closed, Tick, Render, FocusGained, FocusLost, Paste(String), Key(KeyEvent), Mouse(MouseEvent), Resize(u16, u16),
} pub struct Tui { pub terminal: ratatui::Terminal<Backend<std::io::Stderr>>, pub task: JoinHandle<()>, pub cancellation_token: CancellationToken, pub event_rx: UnboundedReceiver<Event>, pub event_tx: UnboundedSender<Event>, pub frame_rate: f64, pub tick_rate: f64,
} impl Tui { pub fn new() -> Result<Self> { let tick_rate = 4.0; let frame_rate = 60.0; let terminal = ratatui::Terminal::new(Backend::new(std::io::stderr()))?; let (event_tx, event_rx) = mpsc::unbounded_channel(); let cancellation_token = CancellationToken::new(); let task = tokio::spawn(async {}); Ok(Self { terminal, task, cancellation_token, event_rx, event_tx, frame_rate, tick_rate }) } pub fn tick_rate(&mut self, tick_rate: f64) { self.tick_rate = tick_rate; } pub fn frame_rate(&mut self, frame_rate: f64) { self.frame_rate = frame_rate; } pub fn start(&mut self) { let tick_delay = std::time::Duration::from_secs_f64(1.0 / self.tick_rate); let render_delay = std::time::Duration::from_secs_f64(1.0 / self.frame_rate); self.cancel(); self.cancellation_token = CancellationToken::new(); let _cancellation_token = self.cancellation_token.clone(); let _event_tx = self.event_tx.clone(); self.task = tokio::spawn(async move { let mut reader = crossterm::event::EventStream::new(); let mut tick_interval = tokio::time::interval(tick_delay); let mut render_interval = tokio::time::interval(render_delay); _event_tx.send(Event::Init).unwrap(); loop { let tick_delay = tick_interval.tick(); let render_delay = render_interval.tick(); let crossterm_event = reader.next().fuse(); tokio::select! { _ = _cancellation_token.cancelled() => { break; } maybe_event = crossterm_event => { match maybe_event { Some(Ok(evt)) => { match evt { CrosstermEvent::Key(key) => { if key.kind == KeyEventKind::Press { _event_tx.send(Event::Key(key)).unwrap(); } }, CrosstermEvent::Mouse(mouse) => { _event_tx.send(Event::Mouse(mouse)).unwrap(); }, CrosstermEvent::Resize(x, y) => { _event_tx.send(Event::Resize(x, y)).unwrap(); }, CrosstermEvent::FocusLost => { _event_tx.send(Event::FocusLost).unwrap(); }, CrosstermEvent::FocusGained => { _event_tx.send(Event::FocusGained).unwrap(); }, CrosstermEvent::Paste(s) => { _event_tx.send(Event::Paste(s)).unwrap(); }, } } Some(Err(_)) => { _event_tx.send(Event::Error).unwrap(); } None => {}, } }, _ = tick_delay => { _event_tx.send(Event::Tick).unwrap(); }, _ = render_delay => { _event_tx.send(Event::Render).unwrap(); }, } } }); } pub fn stop(&self) -> Result<()> { self.cancel(); let mut counter = 0; while !self.task.is_finished() { std::thread::sleep(Duration::from_millis(1)); counter += 1; if counter > 50 { self.task.abort(); } if counter > 100 { log::error!("Failed to abort task in 100 milliseconds for unknown reason"); break; } } Ok(()) } pub fn enter(&mut self) -> Result<()> { crossterm::terminal::enable_raw_mode()?; crossterm::execute!(std::io::stderr(), EnterAlternateScreen, cursor::Hide)?; self.start(); Ok(()) } pub fn exit(&mut self) -> Result<()> { self.stop()?; if crossterm::terminal::is_raw_mode_enabled()? { self.flush()?; crossterm::execute!(std::io::stderr(), LeaveAlternateScreen, cursor::Show)?; crossterm::terminal::disable_raw_mode()?; } Ok(()) } pub fn cancel(&self) { self.cancellation_token.cancel(); } pub fn suspend(&mut self) -> Result<()> { self.exit()?; #[cfg(not(windows))] signal_hook::low_level::raise(signal_hook::consts::signal::SIGTSTP)?; Ok(()) } pub fn resume(&mut self) -> Result<()> { self.enter()?; Ok(()) } pub async fn next(&mut self) -> Option<Event> { self.event_rx.recv().await }
} impl Deref for Tui { type Target = ratatui::Terminal<Backend<std::io::Stderr>>; fn deref(&self) -> &Self::Target { &self.terminal }
} impl DerefMut for Tui { fn deref_mut(&mut self) -> &mut Self::Target { &mut self.terminal }
} impl Drop for Tui { fn drop(&mut self) { self.exit().unwrap(); }
} In the next section, we will introduce a Command pattern to bridge handling the effect of an event.

